import React from 'react';
import './AddWork.css'

var AddWorkField = (
    <div className="add-work-field">
        <input type="text" placeholder="What needs to be done?"></input>
        <button className="btn-add-work">Add</button>
    </div>
);

function AddWork(){
    return AddWorkField;
}

export default AddWork;
